class LongestSubStrWithNoRepeat(object):
    @staticmethod
    def longest_substr_brute(s):
        if len(s) == 0:
            return 0

        final = 1

        for i in range(len(s)):
            seen = {}
            seen[s[i]] = True
            maximum = 1

            for j in range(i + 1, len(s)):
                if s[j] in seen:
                    break

                maximum += 1
                seen[s[j]] = True

            if final < maximum:
                final = maximum

        return final

    @staticmethod
    def longest_substr_opt(s):
        if len(s) == 0:
            return 0

        maximum = 0
        start, end = 0, 0
        seen = {}

        while end < len(s):
            if s[end] in seen:
                if maximum < end - start:
                    maximum = end - start
                del seen[s[start]]
                start += 1
                continue

            if end == len(s)-1:
                if maximum < len(s) - start:
                    maximum = len(s) - start
                break

            seen[s[end]] = True
            end += 1

        return maximum


